import React from "react";

const ThankYouPage = () => {
  return (
    <div>
      <img
        src="https://res.cloudinary.com/dwqdlzlek/image/upload/v1661176973/thankyou_tksvap.png"
        alt=""
      />
      <h1>Thank you for your time</h1>
      <p>This will help us make bus travel safer</p>
    </div>
  );
};

export default ThankYouPage;
